import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";
import {Data} from "./";
const NavBar = () => {
  return (
    <div id="main-menu">
      <menu className="main-menu">
        <label id="hamburger-menu">
          <input type="checkbox" />
          <span className="menu">
            {" "}
            <span className="hamburger"></span>{" "}
          </span>
          <ul className="ul">
            <br />
            <li>
              {" "}
              <Link className="li" to="/">
                Home
              </Link>{" "}
            </li>
            <br /> <br />
            <li>
              {" "}
              <Link className="li" to="/">
                Order
              </Link>{" "}
            </li>{" "}
            <br />
            <br />
            <li>
              {" "}
              <Link className="li" to="/">
                Leaderboards
              </Link>{" "}
            </li>{" "}
            <br />
            <br />
            <li>
              {" "}
              <Link className="li" to="/">
                Marketplace
              </Link>{" "}
            </li>{" "}
            <br />
            <br />
            <li>
              {" "}
              <Link className="li" to="/faqs">
                FAQs
              </Link>{" "}
            </li>{" "}
            <br /> <br />
          </ul>
        </label>
      </menu>
      {/* <div className="div"> */}
      <Link to="/home">
        <img
          className="logo"
          src="./images/Twenteefore - Logo 2.png"
          alt="logo"
        />
      </Link>
      {Data.map((element, index) => {
        return (
          <div key={index}>
            <nav className="navbar">
              <Link className={element.className} to={element.path}>
                {element.name}
              </Link>
            </nav>
          </div>
        );
      })}{" "}
      {/* <Link className="homeLink" to="/">
          Home
        </Link>
        <Link className="orderLink" to="/">
          Order
        </Link>
        <Link className="leaderboardsLink" to="/">
          Leaderboards
        </Link>{" "}
        <Link className="marketplaceLink" to="/">
          Marketplace
        </Link>{" "}
        <Link className="faqsLink" to="/faqs">
          FAQs
        </Link> */}
      {/* </div> */}
      <Link className="loginLink" to="/login">
        <button id="loginLink">Log In</button>
      </Link>
    </div>
  );
};
export default NavBar;
